 */
contract DelegationManager is Ownable, ReentrancyGuard {
    BKCToken public immutable bkcToken;
    address public treasuryWallet;
    address public rewardManagerAddress;

    // --- CONSTANTES DE STAKING (FIXAS) ---
    uint256 public constant MIN_LOCK_DURATION = 1 days;
    uint256 public constant MAX_LOCK_DURATION = 3650 days; // 10 anos
    uint256 public constant VALIDATOR_LOCK_DURATION = 1825 days; // 5 anos
    
    uint256 public constant DELEGATION_FEE_BIPS = 50; // 0.5%
    uint256 public constant ONTIME_UNSTAKE_FEE_BIPS = 100; // 1%
    uint256 public constant FORCE_UNSTAKE_PENALTY_BIPS = 5000; // 50%
    uint256 public constant VALIDATOR_FEE_BIPS = 5; // 0.05%

    uint256 public constant MAX_SUPPLY = 200_000_000 * 10**18;
    uint256 public constant TGE_SUPPLY = 40_000_000 * 10**18;
    uint256 public constant MINT_POOL = MAX_SUPPLY - TGE_SUPPLY;
    
    // --- NOVO: Constante para a taxa base de validador (0.0003% = 3 BIPS)
    uint256 public constant DYNAMIC_STAKE_BIPS = 3; 
    // NOVO: 1% de margem de erro por causa da mineração por compra (10100/10000 = 1.01)
    uint256 public constant SAFETY_MARGIN_BIPS = 10100; 

    struct Validator {
        bool isRegistered;
        uint256 selfStakeAmount;
        uint256 selfStakeUnlockTime;
        uint256 totalPStake;
        uint256 totalDelegatedAmount;
    }

    struct Delegation {
        uint256 amount;
        uint256 unlockTime;
        uint256 lockDuration;
        address validator;
    }
    
    mapping(address => bool) public hasPaidRegistrationFee;
    mapping(address => Validator) public validators;
    mapping(address => Delegation[]) public userDelegations;
    address[] public validatorsArray;
    uint256 public totalNetworkPStake;
    mapping(address => uint256) public userTotalPStake;
    
    uint256 public accValidatorRewardPerStake;
    uint256 public accDelegatorRewardPerStake;
    mapping(address => uint256) public validatorRewardDebt;
    mapping(address => uint256) public delegatorRewardDebt;
    // Eventos
    event ValidatorRegistered(address indexed validator, uint256 selfStake);
    event Delegated(address indexed user, address indexed validator, uint256 delegationIndex, uint256 amount, uint256 feePaid);
    event Unstaked(address indexed user, uint256 delegationIndex, uint256 amount, uint256 feePaid);
    event RewardsDeposited(address indexed from, uint256 validatorAmount, uint256 delegatorAmount);
    event ValidatorRewardClaimed(address indexed validator, uint256 amount);
    event DelegatorRewardClaimed(address indexed delegator, uint256 amount);

    constructor(
        address _bkcTokenAddress,
        address _initialOwner,
        address _treasuryWallet
    ) Ownable(_initialOwner) {
        require(_bkcTokenAddress != address(0), "DM: BKCToken address cannot be zero");
        require(_treasuryWallet != address(0), "DM: Treasury wallet address cannot be zero");
        bkcToken = BKCToken(_bkcTokenAddress);
        treasuryWallet = _treasuryWallet;
    }

    // --- Funções de Configuração ---
    function setRewardManager(address _manager) external onlyOwner {
        require(_manager != address(0), "DM: RewardManager cannot be zero address");
        rewardManagerAddress = _manager;
    }
    
    // --- FUNÇÃO DE CONSULTA DINÂMICA (SUBSTITUI A CONSTANTE FIXA) ---
    /**
     * @notice Calcula dinamicamente o stake mínimo e a taxa de registro para validadores.
     * @dev Usa 0.0003% do Total Supply + 1% de margem de erro para compensar a mineração.
     */
    function getMinValidatorStake() public view returns (uint256) {
        // Cálculo: (TotalSupply * DYNAMIC_STAKE_BIPS / 10000) * SAFETY_MARGIN_BIPS / 10000
        uint256 dynamicStake = (bkcToken.totalSupply() * DYNAMIC_STAKE_BIPS) / 10000;
        return (dynamicStake * SAFETY_MARGIN_BIPS) / 10000;
    }

    // --- Funções de Validador ---

    function payRegistrationFee() external nonReentrant {
        uint256 stakeAmount = getMinValidatorStake();
        require(!hasPaidRegistrationFee[msg.sender], "DM: Fee already paid");
        require(bkcToken.transferFrom(msg.sender, treasuryWallet, stakeAmount), "DM: Fee transfer failed");
        hasPaidRegistrationFee[msg.sender] = true;
    }

    function registerValidator(address _validatorAddress) external nonReentrant {
        uint256 stakeAmount = getMinValidatorStake();
        require(msg.sender == _validatorAddress, "DM: Can only register self");
        require(hasPaidRegistrationFee[msg.sender], "DM: Must pay registration fee first");
        require(!validators[_validatorAddress].isRegistered, "DM: Validator already registered");
        require(bkcToken.transferFrom(msg.sender, address(this), stakeAmount), "DM: Stake transfer failed");

        validators[_validatorAddress] = Validator({
            isRegistered: true,
            selfStakeAmount: stakeAmount,
            selfStakeUnlockTime: block.timestamp + VALIDATOR_LOCK_DURATION,
            totalPStake: _calculatePStake(stakeAmount, VALIDATOR_LOCK_DURATION),
            totalDelegatedAmount: 0
        });
        validatorsArray.push(_validatorAddress);
        
        emit ValidatorRegistered(_validatorAddress, stakeAmount);
    }
    
    // --- Funções de Staking ---
    function delegate(address _validatorAddress, uint256 _totalAmount, uint256 _lockDuration) external nonReentrant {
        _claimDelegatorReward(msg.sender);
        require(validators[_validatorAddress].isRegistered, "DM: Invalid validator");
        require(_totalAmount > 0, "DM: Invalid amount");
        require(_lockDuration >= MIN_LOCK_DURATION && _lockDuration <= MAX_LOCK_DURATION, "DM: Invalid lock duration");
        
        uint256 feeAmount = (_totalAmount * DELEGATION_FEE_BIPS) / 10000;
        uint256 stakeAmount = _totalAmount - feeAmount;
        require(stakeAmount > 0, "DM: Invalid net stake amount");
        require(bkcToken.transferFrom(msg.sender, treasuryWallet, feeAmount), "DM: Failed to pay delegation fee");
        require(bkcToken.transferFrom(msg.sender, address(this), stakeAmount), "DM: Failed to delegate tokens");
        userDelegations[msg.sender].push(Delegation({
            amount: stakeAmount,
            unlockTime: block.timestamp + _lockDuration,
            lockDuration: _lockDuration,
            validator: _validatorAddress
        }));
        uint256 pStake = _calculatePStake(stakeAmount, _lockDuration);
        totalNetworkPStake += pStake;
        validators[_validatorAddress].totalPStake += pStake;
        validators[_validatorAddress].totalDelegatedAmount += stakeAmount;
        userTotalPStake[msg.sender] += pStake;
        delegatorRewardDebt[msg.sender] = userTotalPStake[msg.sender] * accDelegatorRewardPerStake / 1e18;
        
        emit Delegated(msg.sender, _validatorAddress, userDelegations[msg.sender].length - 1, stakeAmount, feeAmount);
    }

    function unstake(uint256 _delegationIndex) external nonReentrant {
        _claimDelegatorReward(msg.sender);
        Delegation[] storage delegationsOfUser = userDelegations[msg.sender];
        require(_delegationIndex < delegationsOfUser.length, "DM: Invalid index");
        
        Delegation storage d = delegationsOfUser[_delegationIndex];
        require(block.timestamp >= d.unlockTime, "DM: Lock period not over");
        
        uint256 pStakeToRemove = _calculatePStake(d.amount, d.lockDuration);
        totalNetworkPStake -= pStakeToRemove;
        validators[d.validator].totalPStake -= pStakeToRemove;
        validators[d.validator].totalDelegatedAmount -= d.amount;
        userTotalPStake[msg.sender] -= pStakeToRemove;
        
        uint256 feeAmount = (d.amount * ONTIME_UNSTAKE_FEE_BIPS) / 10000;
        uint256 amountToUser = d.amount - feeAmount;
        if (feeAmount > 0) {
            require(bkcToken.transfer(treasuryWallet, feeAmount), "DM: Failed to transfer unstake fee");
        }
        
        if (delegationsOfUser.length > 1 && _delegationIndex != delegationsOfUser.length - 1) {
            delegationsOfUser[_delegationIndex] = delegationsOfUser[delegationsOfUser.length - 1];
        }
        delegationsOfUser.pop();
        
        require(bkcToken.transfer(msg.sender, amountToUser), "DM: Failed to transfer tokens back");
        delegatorRewardDebt[msg.sender] = userTotalPStake[msg.sender] * accDelegatorRewardPerStake / 1e18;

        emit Unstaked(msg.sender, _delegationIndex, amountToUser, feeAmount);
    }
    
    function forceUnstake(uint256 _delegationIndex) external nonReentrant {
        _claimDelegatorReward(msg.sender);
        Delegation[] storage delegationsOfUser = userDelegations[msg.sender];
        require(_delegationIndex < delegationsOfUser.length, "DM: Invalid index");
        
        Delegation storage d = delegationsOfUser[_delegationIndex];
        require(block.timestamp < d.unlockTime, "DM: Delegation is already unlocked, use regular unstake");

        uint256 originalAmount = d.amount;
        uint256 penaltyAmount = (originalAmount * FORCE_UNSTAKE_PENALTY_BIPS) / 10000;
        uint256 amountToUser = originalAmount - penaltyAmount;
        
        uint256 pStakeToRemove = _calculatePStake(originalAmount, d.lockDuration);
        totalNetworkPStake -= pStakeToRemove;
        validators[d.validator].totalPStake -= pStakeToRemove;
        validators[d.validator].totalDelegatedAmount -= originalAmount;
        userTotalPStake[msg.sender] -= pStakeToRemove;
        if (penaltyAmount > 0) {
            require(bkcToken.transfer(treasuryWallet, penaltyAmount), "DM: Failed to send penalty to treasury");
        }
        
        require(bkcToken.transfer(msg.sender, amountToUser), "DM: Failed to return tokens to user");
        if (delegationsOfUser.length > 1 && _delegationIndex != delegationsOfUser.length - 1) {
            delegationsOfUser[_delegationIndex] = delegationsOfUser[delegationsOfUser.length - 1];
        }
        delegationsOfUser.pop();
        
        delegatorRewardDebt[msg.sender] = userTotalPStake[msg.sender] * accDelegatorRewardPerStake / 1e18;
        emit Unstaked(msg.sender, _delegationIndex, amountToUser, penaltyAmount);
    }
    
    // --- Funções de Recompensa ---

    function depositRewards(uint256 _validatorAmount, uint256 _delegatorAmount) external nonReentrant {
        if (_validatorAmount > 0 && totalNetworkPStake > 0) {
            // A ser implementado se validadores tiverem um pool separado
        }
        if (_delegatorAmount > 0 && totalNetworkPStake > 0) {
          
            accDelegatorRewardPerStake += (_delegatorAmount * 1e18) / totalNetworkPStake;
        }
        
        emit RewardsDeposited(msg.sender, _validatorAmount, _delegatorAmount);
    }

    function claimDelegatorReward() external nonReentrant {
        _claimDelegatorReward(msg.sender);
    }
    
    function _claimDelegatorReward(address _user) internal {
        uint256 pending = pendingDelegatorRewards(_user);
        if (pending > 0) {
            delegatorRewardDebt[_user] = userTotalPStake[_user] * accDelegatorRewardPerStake / 1e18;
            require(bkcToken.transfer(_user, pending), "DM: Failed to transfer delegator rewards");
            emit DelegatorRewardClaimed(_user, pending);
        }
    }
    
    // --- Funções de Consulta (View) ---
    
    function pendingDelegatorRewards(address _user) public view returns (uint256) {
        return (userTotalPStake[_user] * accDelegatorRewardPerStake / 1e18) - delegatorRewardDebt[_user];
    }
    
    function _calculatePStake(uint256 _amount, uint256 _lockDuration) internal pure returns (uint256) {
        uint256 amountInEther = _amount / 1e18;
        return (amountInEther * (_lockDuration / 1 days));
    }
    
    function getDelegationsOf(address _user) external view returns (Delegation[] memory) {
        return userDelegations[_user];
    }

    function getAllValidators() external view returns (address[] memory) {
        return validatorsArray;
    }
}

contracts/FortuneTiger.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "./BKCToken.sol";
import "./DelegationManager.sol";

/**
 * @title FortuneTiger (ActionManager)
 * @dev Contrato final para Ações Descentralizadas, com taxas fixas e sorteio automatizado.
 * @notice ALTERADO: Em Ações Beneficentes, a recompensa de 4% do criador foi removida e incorporada
 * ao prêmio da causa, que agora é de 92% do total.
 */
contract FortuneTiger is Ownable, ReentrancyGuard {
    BKCToken public immutable bkcToken;
    DelegationManager public immutable delegationManager;
    address public immutable treasuryWallet;

    enum ActionType { Esportiva, Beneficente }
    enum Status { Open, Finalized }

    struct Action {
        uint256 id;
        address creator;
        string description;
        ActionType actionType;
        Status status;
        uint256 endTime;
        uint256 totalPot;
        uint256 creatorStake;
        bool isStakeReturned;
        address beneficiary;
        uint256 totalCoupons;
        address winner;
        uint256 closingBlock;
        uint256 winningCoupon;
    }

    mapping(uint256 => Action) public actions;
    mapping(uint256 => address[]) public couponOwners;
    mapping(uint256 => uint256[]) public couponRanges;

    uint256 public actionCounter;
    uint256 public constant COUPONS_PER_BKC = 1000;
    uint256 public constant DRAW_MAX_OFFSET_BLOCKS = 100;

    // --- TAXAS DE AÇÃO BENEFICENTE (TOTAL 8%) ---
    uint256 public constant BENEFICENT_CAUSE_BIPS = 9200; // ALTERADO: 92% para a Causa
    uint256 public constant BENEFICENT_DELEGATOR_BIPS = 400; // 4% para Delegadores
    uint256 public constant BENEFICENT_TREASURY_BIPS = 400; // 4% para Tesouraria
    uint256 public constant BENEFICENT_CREATOR_BIPS = 0; // ALTERADO: Recompensa do criador é zerada
    
    // --- TAXAS DE AÇÃO ESPORTIVA (TOTAL 12%) ---
    uint256 public constant SPORT_WINNER_BIPS = 8800;
    uint256 public constant SPORT_CREATOR_BIPS = 400;
    uint256 public constant SPORT_DELEGATOR_BIPS = 400;
    uint256 public constant SPORT_TREASURY_BIPS = 400;

    event ActionCreated(uint256 indexed actionId, address indexed creator, ActionType actionType, uint256 endTime, string description);
    event Participation(uint256 indexed actionId, address indexed participant, uint256 bkcAmount, uint256 couponsIssued);
    event ActionFinalized(uint256 indexed actionId, address indexed finalRecipient, uint256 prizeAmount);
    event StakeReturned(uint256 indexed actionId, address indexed creator, uint256 stakeAmount);

    constructor(
        address _bkcTokenAddress,
        address _delegationManagerAddress,
        address _treasuryAddress,
        address _initialOwner
    ) Ownable(_initialOwner) {
        bkcToken = BKCToken(_bkcTokenAddress);
        delegationManager = DelegationManager(_delegationManagerAddress);
        treasuryWallet = _treasuryAddress;
    }

    function getMinCreatorStake() public view returns (uint256) {
        uint256 stake = bkcToken.totalSupply() / 1_000_000;
        return stake > 0 ? stake : 1;
    }

    function createAction(
        uint256 _duration,
        ActionType _actionType,
        uint256 _charityStake,
        string calldata _description
    ) external nonReentrant {
        actionCounter++;
        uint256 newActionId = actionCounter;
        uint256 stakeAmount;
        address beneficiary;
        string memory finalDescription;

        if (_actionType == ActionType.Esportiva) {
            stakeAmount = getMinCreatorStake();
            require(stakeAmount > 0, "Min stake cannot be zero");
            beneficiary = address(0);
            finalDescription = "Sports Lottery Draw";
        } else {
            require(_charityStake > 0, "Charity stake must be > 0");
            stakeAmount = _charityStake;
            beneficiary = msg.sender;
            require(bytes(_description).length > 0 && bytes(_description).length < 500, "Invalid description length");
            finalDescription = _description;
        }
        
        require(bkcToken.transferFrom(msg.sender, address(this), stakeAmount), "Stake transfer failed");

        actions[newActionId] = Action({
            id: newActionId, creator: msg.sender, description: finalDescription, actionType: _actionType,
            status: Status.Open, endTime: block.timestamp + _duration, totalPot: 0, creatorStake: stakeAmount,
            isStakeReturned: false, beneficiary: beneficiary, totalCoupons: 0, winner: address(0),
            closingBlock: 0, winningCoupon: 0
        });

        emit ActionCreated(newActionId, msg.sender, _actionType, actions[newActionId].endTime, finalDescription);
    }

    function participate(uint256 _actionId, uint256 _bkcAmount) external nonReentrant {
        Action storage action = actions[_actionId];
        require(action.status == Status.Open, "Action is not open");
        require(block.timestamp < action.endTime, "Participation time has ended");
        require(_bkcAmount > 0, "Amount must be positive");
        require(bkcToken.transferFrom(msg.sender, address(this), _bkcAmount), "Token transfer failed");
        
        action.totalPot += _bkcAmount;
        uint256 couponsToIssue = 0;
        if (action.actionType == ActionType.Esportiva) {
            couponsToIssue = _bkcAmount * COUPONS_PER_BKC / (10**18);
            require(couponsToIssue > 0, "Amount too small for coupons");
            action.totalCoupons += couponsToIssue;
            couponOwners[_actionId].push(msg.sender);
            couponRanges[_actionId].push(action.totalCoupons);
        }
        emit Participation(_actionId, msg.sender, _bkcAmount, couponsToIssue);
    }
    
    function finalizeAction(uint256 _actionId) external nonReentrant {
        Action storage action = actions[_actionId];
        require(action.status == Status.Open, "Action not open or already finalized");
        require(block.timestamp >= action.endTime, "Action has not ended yet");
        
        uint256 pot = action.totalPot;
        address finalRecipient;
        uint256 prizeAmount;

        if (action.actionType == ActionType.Esportiva) {
            action.closingBlock = block.number;
            uint256 randomSeed = uint256(blockhash(action.closingBlock));
            require(randomSeed != 0, "Closing blockhash not available yet");
            uint256 randomOffset = (randomSeed % DRAW_MAX_OFFSET_BLOCKS) + 1;
            uint256 drawBlock = action.closingBlock + randomOffset;
            bytes32 blockHash = blockhash(drawBlock);
            require(uint256(blockHash) != 0, "Draw blockhash not available yet, try again later");
            
            uint256 winningCouponNumber = (uint256(blockHash) % action.totalCoupons) + 1;
            action.winningCoupon = winningCouponNumber;
            action.winner = _findCouponOwner(_actionId, winningCouponNumber);
            require(action.winner != address(0), "Could not find winner");

            finalRecipient = action.winner;
            prizeAmount = (pot * SPORT_WINNER_BIPS) / 10000;
            _distributeSportFees(pot, action.creator);
        } else {
            finalRecipient = action.beneficiary;
            prizeAmount = (pot * BENEFICENT_CAUSE_BIPS) / 10000;
            _distributeBeneficentFees(pot, action.creator);
        }

        action.status = Status.Finalized;
        _returnCreatorStake(action);
        if (prizeAmount > 0) {
            bkcToken.transfer(finalRecipient, prizeAmount);
        }
        emit ActionFinalized(_actionId, finalRecipient, prizeAmount);
    }
    
    function _distributeBeneficentFees(uint256 _pot, address _creator) internal {
        uint256 delegatorAmount = (_pot * BENEFICENT_DELEGATOR_BIPS) / 10000;
        uint256 treasuryAmount = (_pot * BENEFICENT_TREASURY_BIPS) / 10000;
        uint256 creatorAmount = (_pot * BENEFICENT_CREATOR_BIPS) / 10000; // Será zero
        if (creatorAmount > 0) bkcToken.transfer(_creator, creatorAmount);
        if (delegatorAmount > 0) delegationManager.depositRewards(0, delegatorAmount);
        if (treasuryAmount > 0) bkcToken.transfer(treasuryWallet, treasuryAmount);
    }

    function _distributeSportFees(uint256 _pot, address _creator) internal {
        uint256 creatorAmount = (_pot * SPORT_CREATOR_BIPS) / 10000;
        uint256 delegatorAmount = (_pot * SPORT_DELEGATOR_BIPS) / 10000;
        uint256 treasuryAmount = (_pot * SPORT_TREASURY_BIPS) / 10000;
        if (creatorAmount > 0) bkcToken.transfer(_creator, creatorAmount);
        if (delegatorAmount > 0) delegationManager.depositRewards(0, delegatorAmount);
        if (treasuryAmount > 0) bkcToken.transfer(treasuryWallet, treasuryAmount);
    }
    
    function _returnCreatorStake(Action storage action) internal {
        if (!action.isStakeReturned && action.creatorStake > 0) {
            action.isStakeReturned = true;
            bkcToken.transfer(action.creator, action.creatorStake);
            emit StakeReturned(action.id, action.creator, action.creatorStake);
        }
    }
    
    function _findCouponOwner(uint256 _actionId, uint256 _couponNumber) internal view returns (address) {
        uint256[] memory ranges = couponRanges[_actionId];
        uint256 low = 0;
        uint256 high = ranges.length - 1;
        while (low <= high) {
            uint256 mid = (low + high) / 2;
            uint256 prevRange = (mid == 0) ? 0 : ranges[mid - 1];
            if (_couponNumber > prevRange && _couponNumber <= ranges[mid]) {
                return couponOwners[_actionId][mid];
            } else if (_couponNumber > ranges[mid]) {
                low = mid + 1;
            } else {
                high = mid - 1;
            }
        }
        return address(0);
    }
}

contracts/NFTLiquidityPool.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

// Interface para interagir com o DelegationManager
interface IDelegationManager {
    function depositRewards(uint256 validatorAmount, uint256 delegatorAmount) external;
}

// NOVO: Interface para consultar o boostBips diretamente do contrato de NFT
interface IRewardBoosterNFT {
    function boostBips(uint256 tokenId) external view returns (uint256);
}

/**
 * @title NFTLiquidityPool
 * @dev Versão final aprimorada. Funciona como um AMM aberto para qualquer RewardBoosterNFT.
 * @notice A trava de 30 dias foi REMOVIDA. Qualquer NFT do tipo RewardBooster pode ser vendido ao pool.
 */
contract NFTLiquidityPool is Ownable, ReentrancyGuard, IERC721Receiver {
    IERC20 public immutable bkcToken;
    // ALTERADO: A interface é usada para consultar o contrato de NFT
    IRewardBoosterNFT public immutable rewardBoosterNFT;
    IDelegationManager public immutable delegationManager;
    address public immutable treasuryWallet;

    struct Pool {
        uint256 tokenBalance;
        uint256 nftCount;
        uint256 k;
        bool isInitialized;
    }

    mapping(uint256 => Pool) public pools;
    // REMOVIDO: O mapeamento de timestamp não é mais necessário
    // mapping(uint256 => uint256) public nftPurchaseTimestamp;
    
    // REMOVIDO: O mapeamento de registro interno não é mais necessário
    // mapping(uint256 => uint256) public tokenIdToBoostBips;

    uint256 public constant SELL_FEE_BIPS = 1200; // 12%
    uint256 public constant FEE_SPLIT_DIVISOR = 3;
    // REMOVIDO: A constante de trava não é mais necessária
    // uint256 public constant LOCK_DURATION = 30 days;

    event PoolCreated(uint256 indexed boostBips);
    event LiquidityAdded(uint256 indexed boostBips, uint256 nftAmount, uint256 bkcAmount);
    event NFTsAddedToPool(uint256 indexed boostBips, uint256 nftAmount);
    event NFTBought(address indexed buyer, uint256 indexed boostBips, uint256 tokenId, uint256 price);
    event NFTSold(address indexed seller, uint256 indexed boostBips, uint256 tokenId, uint256 payout, uint256 feePaid);

    constructor(
        address _bkcToken,
        address _rewardBooster,
        address _delegationManager,
        address _treasury,
        address _initialOwner
    ) Ownable(_initialOwner) {
        bkcToken = IERC20(_bkcToken);
        // ALTERADO: O endereço é convertido para a nova interface
        rewardBoosterNFT = IRewardBoosterNFT(_rewardBooster);
        delegationManager = IDelegationManager(_delegationManager);
        treasuryWallet = _treasury;
    }

    function onERC721Received(address, address, uint256, bytes memory) public virtual override returns (bytes4) {
        return this.onERC721Received.selector;
    }

    // --- Funções de Administração (Owner) ---
    // (createPool, addInitialLiquidity, etc. permanecem as mesmas)

    function createPool(uint256 _boostBips) external onlyOwner {
        require(!pools[_boostBips].isInitialized, "Pool already exists");
        pools[_boostBips].isInitialized = true;
        emit PoolCreated(_boostBips);
    }

    function addInitialLiquidity(uint256 _boostBips, uint256[] calldata _tokenIds, uint256 _bkcAmount) external onlyOwner nonReentrant {
        Pool storage pool = pools[_boostBips];
        require(pool.isInitialized, "Pool not initialized");
        require(pool.nftCount == 0, "Liquidity already added");
        require(_tokenIds.length > 0 && _bkcAmount > 0, "Invalid initial liquidity");

        for (uint i = 0; i < _tokenIds.length; i++) {
            IERC721(address(rewardBoosterNFT)).safeTransferFrom(msg.sender, address(this), _tokenIds[i]);
        }

        require(bkcToken.transferFrom(msg.sender, address(this), _bkcAmount), "BKC transfer failed");

        pool.nftCount = _tokenIds.length;
        pool.tokenBalance = _bkcAmount;
        pool.k = pool.nftCount * pool.tokenBalance;

        emit LiquidityAdded(_boostBips, pool.nftCount, pool.tokenBalance);
    }
    
    function addMoreNFTsToPool(uint256 _boostBips, uint256[] calldata _tokenIds) external onlyOwner nonReentrant {
        Pool storage pool = pools[_boostBips];
        require(pool.isInitialized && pool.nftCount > 0, "Pool not initialized with liquidity yet");
        require(_tokenIds.length > 0, "Token IDs array cannot be empty");

        for (uint i = 0; i < _tokenIds.length; i++) {
            IERC721(address(rewardBoosterNFT)).safeTransferFrom(msg.sender, address(this), _tokenIds[i]);
        }

        pool.nftCount += _tokenIds.length;
        pool.k = pool.nftCount * pool.tokenBalance;

        emit NFTsAddedToPool(_boostBips, _tokenIds.length);
    }


    // --- Funções de Negociação ---

    function buyNFT(uint256 _boostBips, uint256 _tokenId) external nonReentrant {
        Pool storage pool = pools[_boostBips];
        require(pool.isInitialized && pool.nftCount > 0, "No NFTs available in this pool");
        // ALTERADO: A verificação de propriedade agora usa a interface IERC721 padrão
        require(IERC721(address(rewardBoosterNFT)).ownerOf(_tokenId) == address(this), "Contract does not own this NFT");
        require(rewardBoosterNFT.boostBips(_tokenId) == _boostBips, "Token does not belong to this tier's pool");

        uint256 price = getBuyPrice(_boostBips);
        require(bkcToken.transferFrom(msg.sender, address(this), price), "BKC transfer failed");
        
        pool.tokenBalance += price;
        pool.nftCount--;
        pool.k = pool.tokenBalance * pool.nftCount;
        
        IERC721(address(rewardBoosterNFT)).safeTransferFrom(address(this), msg.sender, _tokenId);
        emit NFTBought(msg.sender, _boostBips, _tokenId, price);
    }
    
    // FUNÇÃO PRINCIPAL ALTERADA
    function sellNFT(uint256 _tokenId) external nonReentrant {
        require(IERC721(address(rewardBoosterNFT)).ownerOf(_tokenId) == msg.sender, "Not the owner");
        
        // ALTERADO: O tier do NFT é consultado diretamente no contrato do NFT
        uint256 boostBips = rewardBoosterNFT.boostBips(_tokenId);
        require(boostBips > 0, "Not a valid Booster NFT");
        
        Pool storage pool = pools[boostBips];
        require(pool.isInitialized, "Pool does not exist for this tier");
        
        // REMOVIDO: A verificação de trava de 30 dias foi eliminada
        // require(block.timestamp >= nftPurchaseTimestamp[_tokenId] + LOCK_DURATION, "NFT is locked");

        uint256 sellValue = getSellPrice(boostBips);
        require(pool.tokenBalance >= sellValue, "Pool has insufficient liquidity");
        
        uint256 totalFee = (sellValue * SELL_FEE_BIPS) / 10000;
        uint256 feeSplit = totalFee / FEE_SPLIT_DIVISOR;
        uint256 payoutToSeller = sellValue - totalFee;

        // O vendedor transfere o NFT para o pool
        IERC721(address(rewardBoosterNFT)).safeTransferFrom(msg.sender, address(this), _tokenId);

        // O pool distribui os fundos
        if (payoutToSeller > 0) bkcToken.transfer(msg.sender, payoutToSeller);
        if (feeSplit > 0) {
            bkcToken.transfer(treasuryWallet, feeSplit);
            bkcToken.approve(address(delegationManager), feeSplit);
            delegationManager.depositRewards(0, feeSplit);
        }

        // Atualiza o estado do pool
        pool.tokenBalance -= (payoutToSeller + (feeSplit * 2));
        pool.nftCount++;
        pool.k = pool.tokenBalance * pool.nftCount;
        
        emit NFTSold(msg.sender, boostBips, _tokenId, payoutToSeller, totalFee);
    }
    
    // --- Funções de Consulta (View) ---
    // (getBuyPrice e getSellPrice permanecem as mesmas)

    function getBuyPrice(uint256 _boostBips) public view returns (uint256) {
        Pool storage pool = pools[_boostBips];
        if (!pool.isInitialized || pool.nftCount == 0) return type(uint256).max;
        uint256 newY = pool.k / (pool.nftCount - 1);
        return newY - pool.tokenBalance;
    }

    function getSellPrice(uint256 _boostBips) public view returns (uint256) {
        Pool storage pool = pools[_boostBips];
        if (!pool.isInitialized || pool.nftCount == type(uint256).max) return 0;
        uint256 newY = pool.k / (pool.nftCount + 1);
        return pool.tokenBalance - newY;
    }
}

contracts/RewardManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "./BKCToken.sol";
import "./DelegationManager.sol";

/**
 * @title RewardManager (Vesting Certificate NFT + PoP Mining)
 * @dev Gerencia a "Mineração por Compra" e a distribuição de recompensas de mineração.
 * @notice ALTERADO: A lógica de mineração agora se baseia apenas na escassez dinâmica.
 * @notice NOVO: Receptores de certificados de vesting recebem um bônus de 10% sobre o valor minerado,
 * que é adicionado ao seu certificado e travado por 5 anos.
 */
contract RewardManager is ERC721Enumerable, Ownable, ReentrancyGuard {
    BKCToken public immutable bkcToken;
    DelegationManager public delegationManager;
    address public immutable treasuryWallet;
    string private baseURI;

    uint256 public constant MAX_SUPPLY = 200_000_000 * 10**18;
    uint256 public constant TGE_SUPPLY = 40_000_000 * 10**18;
    uint256 public constant MINT_POOL = MAX_SUPPLY - TGE_SUPPLY;

    uint256 private _tokenIdCounter;
    mapping(address => uint256) public minerRewardsOwed;
    
    uint256 private nextValidatorIndex;

    struct VestingPosition {
        uint256 totalAmount;
        uint256 startTime;
    }
    mapping(uint256 => VestingPosition) public vestingPositions;

    uint256 public constant VESTING_DURATION = 5 * 365 days; // 5 anos
    uint256 public constant INITIAL_PENALTY_BIPS = 5000; // Penalidade de 50%

    event VestingCertificateCreated(uint256 indexed tokenId, address indexed recipient, uint256 netAmount);
    event CertificateWithdrawn(uint256 indexed tokenId, address indexed owner, uint256 amountToOwner, uint256 penaltyAmount);
    event MinerRewardClaimed(address indexed miner, uint256 amount);

    constructor(
        address _bkcTokenAddress,
        address _treasuryWallet,
        address _initialOwner
    ) ERC721("Backchain Vesting Certificate", "BKCV") Ownable(_initialOwner) {
        require(_bkcTokenAddress != address(0) && _treasuryWallet != address(0), "Invalid addresses");
        bkcToken = BKCToken(_bkcTokenAddress);
        treasuryWallet = _treasuryWallet;
    }

    function setDelegationManager(address _delegationManagerAddress) external onlyOwner {
        require(_delegationManagerAddress != address(0), "RM: Address cannot be zero");
        require(address(delegationManager) == address(0), "RM: Already set");
        delegationManager = DelegationManager(_delegationManagerAddress);
    }
    
    function setBaseURI(string calldata newBaseURI) external onlyOwner {
        baseURI = newBaseURI;
    }

    function createVestingCertificate(address _recipient, uint256 _grossAmount) external nonReentrant {
        require(address(delegationManager) != address(0), "RM: DelegationManager not set");
        require(_grossAmount > 0, "RM: Amount must be greater than zero");
        require(_recipient != address(0), "RM: Invalid recipient");
        
        // A lógica de taxa de entrada (se houver) permanece a mesma
        uint256 feeAmount = 0;
        uint256 netAmountForVesting = _grossAmount;
        uint256 userPStake = delegationManager.userTotalPStake(msg.sender);
        uint256 totalPStake = delegationManager.totalNetworkPStake();

        if (totalPStake > 0) {
            uint256 userShareBIPS = (userPStake * 10000) / totalPStake;
            if (userShareBIPS < 10) { feeAmount = (_grossAmount * 5) / 100; } 
            else if (userShareBIPS < 100) { feeAmount = (_grossAmount * 2) / 100; }
        } else {
            feeAmount = (_grossAmount * 5) / 100;
        }
        
        if (feeAmount > 0) {
            netAmountForVesting = _grossAmount - feeAmount;
            require(netAmountForVesting > 0, "RM: Amount after fee is zero");
            require(bkcToken.transferFrom(msg.sender, treasuryWallet, feeAmount), "RM: Fee transfer failed");
        }
        
        require(bkcToken.transferFrom(msg.sender, address(this), netAmountForVesting), "RM: Token transfer failed");

        // --- NOVA LÓGICA DE MINERAÇÃO E BÔNUS ---
        uint256 totalMintAmount = _calculateMintAmount(_grossAmount);

        uint256 finalVestingAmount = netAmountForVesting;

        if (totalMintAmount > 0) {
            // 1. Calcular e alocar o bônus de 10% para o receptor
            uint256 recipientRewardAmount = (totalMintAmount * 10) / 100;
            
            // 2. O valor final travado no NFT é a soma do valor do usuário + o bônus
            finalVestingAmount += recipientRewardAmount;

            // 3. Minera o bônus diretamente para este contrato para ser adicionado ao vesting
            if (recipientRewardAmount > 0) {
                bkcToken.mint(address(this), recipientRewardAmount);
            }

            // 4. Seleciona o minerador e distribui o restante das recompensas (90%)
            address selectedMiner = _selectNextValidator();
            require(selectedMiner != address(0), "RM: Could not select a miner");

            uint256 treasuryAmount = (totalMintAmount * 10) / 100;       // 10%
            uint256 minerRewardAmount = (totalMintAmount * 15) / 100;      // 15%
            uint256 delegatorPoolAmount = (totalMintAmount * 65) / 100;    // 65%

            if (treasuryAmount > 0) bkcToken.mint(treasuryWallet, treasuryAmount);
            
            if (minerRewardAmount > 0) {
                minerRewardsOwed[selectedMiner] += minerRewardAmount;
                bkcToken.mint(address(this), minerRewardAmount);
            }
            
            if (delegatorPoolAmount > 0) {
                bkcToken.mint(address(this), delegatorPoolAmount);
                bkcToken.approve(address(delegationManager), delegatorPoolAmount);
                // Envia 100% dos fundos do pool para os delegadores (0 para validadores)
                delegationManager.depositRewards(0, delegatorPoolAmount);
            }
        }
        
        // 5. Cria o NFT com o valor final (valor do usuário + bônus se houver)
        uint256 tokenId = _tokenIdCounter++;
        _safeMint(_recipient, tokenId);
        vestingPositions[tokenId] = VestingPosition({ totalAmount: finalVestingAmount, startTime: block.timestamp });
        emit VestingCertificateCreated(tokenId, _recipient, finalVestingAmount);
    }

    function withdraw(uint256 _tokenId) external nonReentrant {
        require(ownerOf(_tokenId) == msg.sender, "Not the owner");
        VestingPosition storage position = vestingPositions[_tokenId];
        (uint256 amountToOwner, uint256 penaltyAmount) = _calculateWithdrawalAmounts(position);
        delete vestingPositions[_tokenId];
        _burn(_tokenId);
        if (penaltyAmount > 0) require(bkcToken.transfer(treasuryWallet, penaltyAmount));
        if (amountToOwner > 0) require(bkcToken.transfer(msg.sender, amountToOwner));
        emit CertificateWithdrawn(_tokenId, msg.sender, amountToOwner, penaltyAmount);
    }
    
    function claimMinerRewards() external nonReentrant {
        uint256 amountToClaim = minerRewardsOwed[msg.sender];
        require(amountToClaim > 0, "RM: No miner rewards to claim");
        minerRewardsOwed[msg.sender] = 0;
        require(bkcToken.transfer(msg.sender, amountToClaim), "RM: Failed to transfer miner rewards");
        emit MinerRewardClaimed(msg.sender, amountToClaim);
    }

    function _calculateWithdrawalAmounts(VestingPosition memory _pos) internal view returns (uint256, uint256) {
        uint256 elapsedTime = block.timestamp - _pos.startTime;
        if (elapsedTime >= VESTING_DURATION) return (_pos.totalAmount, 0);
        
        // A penalidade é fixa em 50% para retirada antecipada, como discutido.
        uint256 penaltyAmount = (_pos.totalAmount * INITIAL_PENALTY_BIPS) / 10000;
        return (_pos.totalAmount - penaltyAmount, penaltyAmount);
    }

    // --- LÓGICA DE MINERAÇÃO SIMPLIFICADA ---
    function _calculateMintAmount(uint256 _purchaseAmount) internal view returns (uint256) {
        uint256 currentSupply = bkcToken.totalSupply();
        if (currentSupply >= MAX_SUPPLY) { return 0; }

        uint256 currentMinted = currentSupply > TGE_SUPPLY ?
            currentSupply - TGE_SUPPLY : 0;
        uint256 remainingMintable = MINT_POOL - currentMinted;
        if (remainingMintable == 0) { return 0; }

        // Apenas a escassez dinâmica é usada
        uint256 scarcityRate = (remainingMintable * 1e18) / MINT_POOL;
        uint256 finalMintAmount = (_purchaseAmount * scarcityRate) / 1e18;

        // Garante que não ultrapasse o MAX_SUPPLY
        if (currentSupply + finalMintAmount > MAX_SUPPLY) {
            finalMintAmount = MAX_SUPPLY - currentSupply;
        }

        return finalMintAmount;
    }

    function _selectNextValidator() internal returns (address) {
        address[] memory validators = delegationManager.getAllValidators();
        uint256 count = validators.length;
        if (count == 0) return address(0);

        if (nextValidatorIndex >= count) { nextValidatorIndex = 0; }
        address selectedValidator = validators[nextValidatorIndex];
        nextValidatorIndex = (nextValidatorIndex + 1) % count;
        return selectedValidator;
    }
    
    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        require(ownerOf(tokenId) != address(0), "ERC721: invalid token ID");
        return string(abi.encodePacked(baseURI, "vesting_cert.json"));
    }

    function _update(address to, uint256 tokenId, address auth) internal override(ERC721Enumerable) returns (address) {
        return super._update(to, tokenId, auth);
    }
    
    function supportsInterface(bytes4 interfaceId) public view override(ERC721Enumerable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}

